import React,{Component} from 'react';
//style importer
// import * as style__ from './style';
//component importer
//utils importer
interface Props {
	isFormDisPlay: (status:boolean) => void,
	stateUser:boolean
}
type State = typeof initState;

const initState = {
  status: false as boolean
}
export default class SignInForm extends Component<Props,State>{
	state = initState

	formDisplay = () => {
        this.props.isFormDisPlay(!this.props.stateUser);
	}
	
    render(){
      return (
		<div style={{position:"absolute", top:"50%",left:"50%",transform:"translate(-50%,-50%)"}}>
			<form action="">
				<label htmlFor=""> CMND: <input type="text"/></label>
				<label htmlFor="">Password: <input type="password"/></label>
				<hr/>
				<span>Bạn chưa có tài khoản ?</span>
				<span onClick={this.formDisplay}>Cancel</span>
			</form>
		</div>
	  )
    }
};
